import { usersApi } from "../../api";
import { AddUserType } from "../../types/models";

const useUsers = () =>{
    const addUser= async(datos: AddUserType) =>{     
        
        await usersApi.addUser(datos)
        
    };
    return {addUser}
}

export {useUsers}
